import React, { useContext, useEffect, useState } from "react";
import Moda from "../Moda"
import { Outlet } from "react-router-dom";
import ProductsList from "../Products/ProductsList";
import GenderGallery from './GenderGallery'
import { PagesContext } from "../Context/PagesProvider";
import ProductsContext from '../Context/ProductsContext'
function Gender() {
   //pageYo
   const { pageY0 } = useContext(PagesContext)
   useEffect(() => {
      pageY0()
   }, [])
   const [gallery, setGallery] = useState()
   useEffect(() => {
      fetch("http://localhost:3000/GalleryProduct")
         .then(data => data.json())
         .then(data => setGallery(data))
   }, [])
   const { products } = useContext(ProductsContext)
   return (
      <>
         <Outlet />
         <GenderGallery />
         <Moda />
         <div class="feture">
            <div class="container">
               <div class="feture__title">
                  <h2>Мы рекомендуем</h2>
                  <span>Обнови гардероб! Покупай товары по нашим рекомендациям</span>
               </div>
            </div>
            <ProductsList products={products} />

         </div>
      </>
   )
}
export default Gender
